/*---------------------------------------------------- QUERIES ----------------------------------------------------*/

/*---------------------------------------------------- QUERY 1 ----------------------------------------------------*/
/* if a picture size is less than a certain amount, then it's too small (case function)*/
/* Photo Quality alert*/
select pp.user_ID,  pp.picture_URL, pp.size_KB,
case
	when pp.size_KB between 3600 and 5700 then "ok"
	when pp.size_KB > 5700 then "compression required"
	else "low quality alert"
end as PhotoStatus
from personal_pictures as pp
order by user_id;


/*---------------------------------------------------- QUERY 2 ----------------------------------------------------*/
/* Get the status of matches*/
create view matchstatus as
select A.user_ID1,  A.user_ID2 as user_ID1seesuser_ID2, A.user_ID1_action, A.date_seen as user_ID1date_seen, B.user_ID1 as user_ID2,  B.user_ID2 as user_ID2seesuser_ID1, B.user_ID1_action as user_ID2_action,B.date_seen as user_ID2date_seen,
case
	when A.user_ID1_action="right swipe" and (B.user_ID1_action="right swipe" or B.user_ID1_action="super swipe") then "match"
    when A.user_ID1_action="super swipe" and (B.user_ID1_action="right swipe" or B.user_ID1_action="super swipe") then "match"
    when B.user_ID1_action="right swipe" and (A.user_ID1_action="right swipe" or A.user_ID1_action="super swipe") then "match"
    when B.user_ID1_action="super swipe" and (A.user_ID1_action="right swipe" or A.user_ID1_action="super swipe") then "match"
	else "not a match"
end as matchstatus
from user_has_seen as A, user_has_seen as B
where A.user_ID1=B.user_ID2 and A.user_ID2=B.user_ID1 ;

/* straight women*/
select "straight women" as genderorientation, concat(round(count(*)/totalidegender*100,2),"%") as "Percentage of matches in that gender/orientation group"
from matchstatus, user_info, gender_orientation, (select count(*) as totalidegender from matchstatus, user_info where user_info.idgender_orientation=2001 and matchstatus.user_ID1=user_info.user_ID) as nummatches
where matchstatus.user_ID1=user_info.user_ID and user_info.idgender_orientation=gender_orientation.idgender_orientation and user_info.idgender_orientation=2001 and matchstatus="match"

union

/* straight men*/
select "straight men" as genderorientation, concat(round(count(*)/totalidegender*100,2),"%") as "Percentage of matches in that gender/orientation group"
from matchstatus, user_info, gender_orientation, (select count(*) as totalidegender from matchstatus, user_info where user_info.idgender_orientation=2002 and matchstatus.user_ID1=user_info.user_ID) as nummatches
where matchstatus.user_ID1=user_info.user_ID and user_info.idgender_orientation=gender_orientation.idgender_orientation and user_info.idgender_orientation=2002 and matchstatus="match"

union

/*gay men*/
select "gay men" as genderorientation, concat(round(count(*)/totalidegender*100,2),"%") as "Percentage of matches in that gender/orientation group"
from matchstatus, user_info, gender_orientation, (select count(*) as totalidegender from matchstatus, user_info where user_info.idgender_orientation=2004 and matchstatus.user_ID1=user_info.user_ID) as nummatches
where matchstatus.user_ID1=user_info.user_ID and user_info.idgender_orientation=gender_orientation.idgender_orientation and user_info.idgender_orientation=2004 and matchstatus="match"

union

/* lesbian women*/
select "lesbian women" as genderorientation, concat(round(count(*)/totalidegender*100,2),"%") as "Percentage of matches in that gender/orientation group"
from matchstatus, user_info, gender_orientation, (select count(*) as totalidegender from matchstatus, user_info where user_info.idgender_orientation=2006 and matchstatus.user_ID1=user_info.user_ID) as nummatches
where matchstatus.user_ID1=user_info.user_ID and user_info.idgender_orientation=gender_orientation.idgender_orientation and user_info.idgender_orientation=2006 and matchstatus="match"

union

/* bi women*/
select "bi-sexual women" as genderorientation, concat(round(count(*)/totalidegender*100,2),"%") as "Percentage of matches in that gender/orientation group"
from matchstatus, user_info, gender_orientation, (select count(*) as totalidegender from matchstatus, user_info where user_info.idgender_orientation=2003 and matchstatus.user_ID1=user_info.user_ID) as nummatches
where matchstatus.user_ID1=user_info.user_ID and user_info.idgender_orientation=gender_orientation.idgender_orientation and user_info.idgender_orientation=2003 and matchstatus="match"

union
/* bi men*/
select "bi-sexual men" as genderorientation, concat(round(count(*)/totalidegender*100,2),"%") as "Percentage of matches in that gender/orientation group"
from matchstatus, user_info, gender_orientation, (select count(*) as totalidegender from matchstatus, user_info where user_info.idgender_orientation=2005 and matchstatus.user_ID1=user_info.user_ID) as nummatches
where matchstatus.user_ID1=user_info.user_ID and user_info.idgender_orientation=gender_orientation.idgender_orientation and user_info.idgender_orientation=2005 and matchstatus="match";


/*---------------------------------------------------- QUERY 3 ----------------------------------------------------*/
/* percentage of each zodiac*/
SELECT zodiac, concat(TRUNCATE((COUNT(*)*100/ (
	SELECT COUNT(*) AS total_users
	FROM user_info
	)),2),"%") AS Percentage_of_total_users
FROM user_info
GROUP BY zodiac
ORDER BY Percentage_of_total_users desc;



/*---------------------------------------------------- QUERY 4 ----------------------------------------------------*/
/* is there a time of year (specific month, day of the week, etc) where more matches happen? */
/* PLEASE RUN QUERY 8 FIRST BEFORE RUNNING THIS QUERY / QUERY 4. QUERY 8 IS A VIEW TABLE THAT IS USED IN QUERY 4 */
/* by month */
select 
CASE
	WHEN MONTH(matchdate) = 1 THEN "January"
    WHEN MONTH(matchdate) = 2 THEN "February"
    WHEN MONTH(matchdate) = 3 THEN "March"
    WHEN MONTH(matchdate) = 4 THEN "April"
    WHEN MONTH(matchdate) = 5 THEN "May"
    WHEN MONTH(matchdate) = 6 THEN "June"
    WHEN MONTH(matchdate) = 7 THEN "July"
    WHEN MONTH(matchdate) = 8 THEN "August"
    WHEN MONTH(matchdate) = 9 THEN "September"
    WHEN MONTH(matchdate) = 10 THEN "October"
    WHEN MONTH(matchdate) = 11 THEN "November"
    ELSE "December"
END AS Month, COUNT(*) AS Total_matches 
from 
(select *, 
case
	when user_ID1date_seen> user_ID2date_seen then user_ID1date_seen
    else user_ID2date_seen
end as matchdate
from matches) as matchesupdated
group by month
order by Total_matches desc;

/* by weekday*/
select 
CASE
	WHEN weekday(matchdate) = 0 THEN "Monday"
    WHEN weekday(matchdate) = 1 THEN "Tuesday"
    WHEN weekday(matchdate) = 2 THEN "Wednesday"
    WHEN weekday(matchdate) = 3 THEN "Thursday"
    WHEN weekday(matchdate) = 4 THEN "Friday"
    WHEN weekday(matchdate) = 5 THEN "Saturday"
    WHEN weekday(matchdate) = 6 THEN "Sunday"
    ELSE NULL
END AS Weekdays, COUNT(*) AS Total_matches 
from (select *, 
case
	when user_ID1date_seen> user_ID2date_seen then user_ID1date_seen
    else user_ID2date_seen
end as matchdate
from matches) as matchesupdated
group by Weekdays
order by Total_matches desc;


/*---------------------------------------------------- QUERY 5 ----------------------------------------------------*/
/* Do people with pets match more than people without pets*/
SELECT concat(round(pet.pet_count/all_included.all_count*100,2),"%") AS has_pet_in_matched, concat(round((1-pet.pet_count/all_included.all_count)*100,2),"%") AS has_no_pet_in_matched
FROM(
	SELECT COUNT(pett.has_pet) AS pet_count
	FROM(
		SELECT i.user_ID AS has_pet
		FROM user_info AS i
		INNER JOIN user_info_has_pet AS ipet ON i.user_ID = ipet.user_ID
		WHERE ipet.quantity IS NOT NULL
		AND i.user_ID IN (
		SELECT DISTINCT user_ID1
		FROM(
			SELECT A.user_ID1
			FROM user_has_seen AS A, user_has_seen AS B
			WHERE A.user_ID1=B.user_ID2 
			AND A.user_ID2=B.user_ID1
			AND ((A.user_ID1_action="right swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe"))
				OR
			(A.user_ID1_action="super swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe")))
			UNION
			SELECT A.user_ID2
			FROM user_has_seen AS A, user_has_seen AS B
			WHERE A.user_ID1=B.user_ID2 
			AND A.user_ID2=B.user_ID1
			AND ((A.user_ID1_action="right swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe"))
				OR
			(A.user_ID1_action="super swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe")))
			) AS unioned
        )
		GROUP BY i.user_ID) AS pett
	) AS pet
,
	(SELECT COUNT(alll.all_matched_count) AS all_count
	FROM(
		SELECT i.user_ID AS all_matched_count
		FROM user_info AS i
		INNER JOIN user_info_has_pet AS ipet ON i.user_ID = ipet.user_ID
		WHERE i.user_ID IN (
		SELECT DISTINCT user_ID1
		FROM(
			SELECT A.user_ID1
			FROM user_has_seen AS A, user_has_seen AS B
			WHERE A.user_ID1=B.user_ID2 
			AND A.user_ID2=B.user_ID1
			AND ((A.user_ID1_action="right swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe"))
				OR
			(A.user_ID1_action="super swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe")))
			UNION
			SELECT A.user_ID2
			FROM user_has_seen AS A, user_has_seen AS B
			WHERE A.user_ID1=B.user_ID2 
			AND A.user_ID2=B.user_ID1
			AND ((A.user_ID1_action="right swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe"))
				OR
			(A.user_ID1_action="super swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe")))
			) AS unioned
        )
		GROUP BY i.user_ID) AS alll
	) AS all_included;


/*---------------------------------------------------- QUERY 6 ----------------------------------------------------*/
/* which height ranges are most popular for matches : finding which height range match best together (for example 1.50m men match best with 1.60 women)*/
CREATE view height_match AS(
	SELECT u.user_ID AS ID1, u.height_cm AS h1, B2.ID2 AS ID2, B2.h2 AS h2
	FROM user_info as u
	INNER JOIN (
		SELECT A.user_ID1 AS user1
		FROM user_has_seen AS A, user_has_seen AS B
		WHERE A.user_ID1=B.user_ID2 
		AND A.user_ID2=B.user_ID1
		AND ((A.user_ID1_action="right swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe"))
			OR
		(A.user_ID1_action="super swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe")))
		) AS A ON A.user1 = u.user_ID
	INNER JOIN (     
		SELECT u.user_ID AS ID2, u.height_cm AS h2, B.u1 AS user_match
		FROM user_info as u
		INNER JOIN (
			SELECT A.user_ID2 AS user2, A.user_ID1 AS u1
			FROM user_has_seen AS A, user_has_seen AS B
			WHERE A.user_ID1=B.user_ID2 
			AND A.user_ID2=B.user_ID1
			AND ((A.user_ID1_action="right swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe"))
				OR
			(A.user_ID1_action="super swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe")))
			) AS B ON B.user2 = u.user_ID
		) AS B2 ON B2.user_match = A.user1
);

CREATE view height_matched AS (
	SELECT 
		(CASE WHEN ((h1>=150 AND h1<=159) AND (h2>=150 AND h2<=159)) THEN 1 ELSE 0 END) AS match_150_150,
		(CASE WHEN ((h1>=160 AND h1<=169) AND (h2>=160 AND h2<=169)) THEN 1 ELSE 0 END) AS match_160_160,
		(CASE WHEN ((h1>=170 AND h1<=179) AND (h2>=170 AND h2<=179)) THEN 1 ELSE 0 END) AS match_170_170,
		(CASE WHEN ((h1>=180 AND h1<=190) AND (h2>=180 AND h2<=190)) THEN 1 ELSE 0 END) AS match_180_180,
		(CASE WHEN (((h1>=150 AND h1<=159) AND (h2>=160 AND h2<=169)) AND ((h1>=160 AND h1<=169) AND (h2>=150 AND h2<=159))) THEN 1 ELSE 0 END) AS match_150_160,
		(CASE WHEN (((h1>=150 AND h1<=159) AND (h2>=170 AND h2<=179)) AND ((h1>=170 AND h1<=179) AND (h2>=150 AND h2<=159))) THEN 1 ELSE 0 END) AS match_150_170,
		(CASE WHEN (((h1>=150 AND h1<=159) AND (h2>=180 AND h2<=190)) AND ((h1>=180 AND h1<=190) AND (h2>=150 AND h2<=159))) THEN 1 ELSE 0 END) AS match_150_180,
		(CASE WHEN (((h1>=160 AND h1<=169) AND (h2>=170 AND h2<=179)) AND ((h1>=170 AND h1<=179) AND (h2>=160 AND h2<=169))) THEN 1 ELSE 0 END) AS match_160_170,
		(CASE WHEN (((h1>=160 AND h1<=169) AND (h2>=180 AND h2<=190)) AND ((h1>=180 AND h1<=190) AND (h2>=160 AND h2<=169))) THEN 1 ELSE 0 END) AS match_160_180,
		(CASE WHEN (((h1>=170 AND h1<=179) AND (h2>=180 AND h2<=190)) AND ((h1>=180 AND h1<=190) AND (h2>=170 AND h2<=179))) THEN 1 ELSE 0 END) AS match_170_180
	FROM height_match
);

SELECT 
	SUM(match_150_150) AS match_150_150, SUM(match_160_160) AS match_160_160, SUM(match_170_170) AS match_170_170, SUM(match_180_180) AS match_180_180,
    SUM(match_150_160) AS match_150_160, SUM(match_150_170) AS match_150_170, SUM(match_150_180) AS match_150_180, SUM(match_160_170) AS match_160_170,
    SUM(match_160_180) AS match_160_180, SUM(match_170_180) AS match_170_180
FROM `height_matched`;



/*---------------------------------------------------- QUERY 7 ----------------------------------------------------*/
/* Compare the convert rate of swipe to matches of each weekdays */
SELECT 
(CASE
    WHEN matched.weekdays = 0 THEN "Monday"
    WHEN matched.weekdays = 1 THEN "Tuesday"
    WHEN matched.weekdays = 2 THEN "Wednesday"
    WHEN matched.weekdays = 3 THEN "Thursday"
    WHEN matched.weekdays = 4 THEN "Friday"
    WHEN matched.weekdays = 5 THEN "Saturday"
    WHEN matched.weekdays = 6 THEN "Sunday"
   	    ELSE NULL
   	    END) AS Weekday,
CONCAT(ROUND(matched.match_date/swipe_date*100,2),"%") AS swipe_to_match_convert_rate, SUM(matched.match_date) AS matches_made, SUM(swipes.swipe_date) AS swipes_made
FROM (
	SELECT WEEKDAY(A.date_seen) AS weekdays, COUNT(WEEKDAY(A.date_seen)) AS match_date
	FROM user_has_seen AS A, user_has_seen AS B
	WHERE A.user_ID1=B.user_ID2 
	AND A.user_ID2=B.user_ID1
	AND ((A.user_ID1_action="right swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe"))
	OR
	(A.user_ID1_action="super swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe")))
	GROUP BY WEEKDAY(A.date_seen)
    ) AS matched
INNER JOIN (
	SELECT WEEKDAY(date_seen) AS weekdays, COUNT(WEEKDAY(date_seen)) AS swipe_date
	FROM user_has_seen
	GROUP BY WEEKDAY(date_seen)
) AS swipes ON matched.weekdays = swipes.weekdays
GROUP BY matched.weekdays
ORDER BY matched.match_date/swipe_date DESC;


