/* Get a list of all the people that right swiped/super swiped on each other*/
create view matches as
select A.user_ID1,  A.user_ID2 as user_ID1seesuser_ID2, A.user_ID1_action, A.date_seen as user_ID1date_seen, B.user_ID1 as user_ID2,  B.user_ID2 as user_ID2seesuser_ID1, B.user_ID1_action as user_ID2_action, B.date_seen as user_ID2date_seen
from user_has_seen as A, user_has_seen as B
where A.user_ID1=B.user_ID2 and A.user_ID2=B.user_ID1 and (A.user_ID1_action="right swipe" or A.user_ID1_action="super swipe") and (B.user_ID1_action="right swipe" or B.user_ID1_action="super swipe")
;


/*---------------------------------------------------- QUERY 9 ----------------------------------------------------*/
/*show users that were swiped right on the most (top users)*/

select user_ID2 as UserID, concat(user_info.first_name," ", user_info.last_name) as Name, sexual_orientation, gender, count(*) as "number of favourable swipes"
from user_info, user_has_seen, gender_orientation
where (user_has_seen.user_ID1_action="right swipe" or user_has_seen.user_ID1_action="super_swipe") and user_info.user_ID=user_has_seen.user_ID2 and gender_orientation.idgender_orientation=user_info.idgender_orientation
