/*---------------------------------------------------- QUERY 10 ----------------------------------------------------*/

/*get a list of all the people that attended the same event and see if there were people that ended up swiping right at some point*/

/* Get the list of events for each userID in user has seen*/
create view userevent as
select user_ID1 as user_ID, event_name, date
from user_has_seen, user_info, user_info_has_event, event
where user_has_seen.user_ID1=user_info.user_ID and user_info.user_ID=user_info_has_event.user_ID and user_info_has_event.event_id=event.event_id;

/* Display the events and matches*/
select userid1event.user_ID1+userid1event.user_ID2 as matchID, userid1event.user_ID1, userid1event.user_ID1date_seen, userid1event.user_ID1event, userid1event.user_ID1eventdate, userif2event.user_ID2, userif2event.user_ID2date_seen, userif2event.user_ID2event, userif2event.user_ID2eventdate
from
/* userid1 events*/
(select user_ID1, user_ID2, user_ID1date_seen, event_name as user_ID1event, date as user_ID1eventdate
from matches, userevent
where user_ID1=user_ID) as userid1event, 
/*userid2 events*/
(select user_ID1, user_ID2, user_ID2date_seen, event_name as user_ID2event, date as user_ID2eventdate
from matches, userevent
where user_ID2=user_ID) as userif2event
where userid1event.user_ID2=userif2event.user_ID2 and userid1event.user_ID1=userif2event.user_ID1 and userid1event.user_ID1event=userif2event.user_ID2event
group by matchID;



/*---------------------------------------------------- QUERY 11 ----------------------------------------------------*/
/* Do those with the premium plan receive more matches than those without?*/
create view userssubscription as
select account_has_subscription.user_id, subscription.subscription_name, date_started,
case
	when account_has_subscription.date_ended is null then CURRENT_DATE 
    else account_has_subscription.date_ended
end as subenddate
from subscription, account_has_subscription
where subscription.subscriptionID=account_has_subscription.subscriptionid order by user_id;

select subscription_name, matchstatus, count(*) as numberofswipes, concat(round(count(*)/total*100,2), "%") as "Percent by subscription"
from matchstatus, userssubscription, 
(Select count(*) as total
from matchstatus, userssubscription
where user_ID1=user_id and user_ID1date_seen>=date_started and user_ID1date_seen<subenddate and subscription_name="BumbleBoost") as total
where user_ID1=user_id and user_ID1date_seen>=date_started and user_ID1date_seen<subenddate and subscription_name="BumbleBoost"
group by subscription_name, matchstatus
union 
select subscription_name, matchstatus, count(*) as numberofswipes, concat(round(count(*)/total*100,2), "%") as "Percent by subscription"
from matchstatus, userssubscription, 
(Select count(*) as total
from matchstatus, userssubscription
where user_ID1=user_id and user_ID1date_seen>=date_started and user_ID1date_seen<subenddate and subscription_name="Free") as total
where user_ID1=user_id and user_ID1date_seen>=date_started and user_ID1date_seen<subenddate and subscription_name="Free"
group by subscription_name, matchstatus;


/*---------------------------------------------------- QUERY 12 ----------------------------------------------------*/
/*The average number of swipes of our least active users (last active date > 2 months) : which illustrates the number of swipes needed to find "love"*/
SELECT total.swipe/success.suc AS average_swipe
FROM (SELECT count(A.user_ID1) AS suc
	FROM user_has_seen AS A, user_has_seen AS B, Account_and_login_info AS info, user_info AS u
	WHERE A.user_ID1=B.user_ID2 
	AND A.user_ID2=B.user_ID1
	AND A.user_ID1 = u.user_ID
	AND info.user_ID = u.user_ID
	AND ((A.user_ID1_action="right swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe"))
	  OR
	 (A.user_ID1_action="super swipe" AND (B.user_ID1_action="right swipe" OR B.user_ID1_action="super swipe"))
	)
	AND DATEDIFF("2021-09-10",info.last_active_date) > 60
    ) as success
    ,
    (SELECT count(A.user_ID1) as swipe
	FROM user_has_seen AS A, Account_and_login_info AS info, user_info AS u
	WHERE A.user_ID1=info.user_ID
	AND info.user_ID = u.user_ID
    ) AS total;


/*---------------------------------------------------- QUERY 13 ----------------------------------------------------*/
/*Calculate total revenue from subscriptions (all time revenue)*/
SELECT CONCAT("$",ROUND(SUM(CEILING(DATEDIFF(
IFNULL(ahs.date_ended,'2021-09-12'),ahs.date_started)/30))*AVG(s.monthly_price),2)) 
AS total_revenue
FROM account_has_subscription AS ahs, Subscription AS s
WHERE ahs.subscriptionID = s.subscriptionID
AND ahs.subscriptionID = 102;



/*---------------------------------------------------- QUERY 14 ----------------------------------------------------*/
/*find the conversion rate of users changing from free subscription to paid subscription*/
SELECT concat(round(COUNT(DISTINCT sub.idNum)/COUNT(DISTINCT ahs.user_ID)*100,2),"%") AS conversion_rate
FROM account_has_subscription AS ahs,
(
SELECT ahs.user_ID as idNum
FROM account_has_subscription AS ahs
GROUP BY ahs.user_ID
HAVING SUM(ahs.subscriptionID=102)=1
) AS sub;


