/*---------------------------------------------------- QUERY 19 ----------------------------------------------------*/

/*try and find matches that have the most characteristics in common with each other (from the user info table)*/
/*generations takes from https://dailyfreepress.com/2021/03/15/generation-names-explained/     */
/*updated userinfo table*/
create view updateduserinfo as
select user_info.user_ID, first_name, last_name, zodiac, 
case
	when year(birthdate)<=1964 then "Boomer"
    when year(birthdate)<=1980 then "Gen X"
	when year(birthdate)<=1996 then "Gen Y"
	else "Gen Z"
end as "Generation", education_level, drinking, smoking, religion, politics, sexual_orientation, city, haspet
from user_info, location, gender_orientation,
(select distinct user_id,
case
	when Quantity is null then "no"
    else "yes" 
end as haspet
from user_info_has_pet) as userhaspet
where user_info.current_latitude_longitude=location.latitude_longitude and user_info.idgender_orientation=gender_orientation.idgender_orientation and userhaspet.user_id=user_info.user_id;


/* create binary coding*/
create view sameuserinterest as
select user_ID1, concat(A.first_name, " ", A.last_name) as user_ID1_Name, user_ID2, concat(B.first_name, " ", B.last_name) as user_ID2_Name,
case
	when A.zodiac=B.zodiac then 1
    else 0
end as samezodiac,

case
	when A.Generation=B.Generation then 1
    else 0
end as samegeneration,

case
	when A.education_level=B.education_level then 1
    else 0
end as sameeducation,

case
	when A.drinking=B.drinking then 1
    else 0
end as samedrinking,

case
	when A.smoking=B.smoking then 1
    else 0
end as samesmoking,

case
	when A.religion=B.religion then 1
    else 0
end as samereligion,

case
	when A.politics=B.politics then 1
    else 0
end as samepolitics,

case
	when A.sexual_orientation=B.sexual_orientation then 1
    else 0
end as samesexualorientation,

case
	when A.city=B.city then 1
    else 0
end as samecity,

case
	when A.haspet=B.haspet then 1
    else 0
end as samehaspet

from 
(select user_ID1, user_ID2 from matchstatus where matchstatus="match") as matches,updateduserinfo as A, updateduserinfo as B
where matches.user_ID1=A.user_id and matches.user_ID2=B.user_ID;

/* display the compatibility score of the matched individuals*/
select user_ID1+user_ID2 as matchID, user_ID1, user_ID1_Name, user_ID2, user_ID2_Name, concat(round((samezodiac+samegeneration+sameeducation+samedrinking+samesmoking+samereligion+samepolitics+samesexualorientation+samecity+samehaspet)/10*100,0),"%") as "Compatibility Score"
from sameuserinterest
group by matchID
order by (samezodiac+samegeneration+sameeducation+samedrinking+samesmoking+samereligion+samepolitics+samesexualorientation+samecity+samehaspet)/10*100 desc;



